import React from 'react';
import logoBrainFlix from '../../Assets/Logo/Logo-brainflix.png';
import imgNavSearch from '../../Assets/Icon/Icon-search.png';
import imgNavUpload from '../../Assets/Icon/Icon-upload.png';
import imgNavPerson from '../../Assets/Images/Mohan-muruge.jpg';
import './Header.scss';



const Header = () => {
    return (
      <header className="header">
        <img src={logoBrainFlix} alt="Logo"/>
        <nav>
            <div className="navSearch">
                <img src={imgNavSearch} alt="imgNavSearch"/>
                <span>Search</span>
            </div>
            <div className="navUpload">
                <img src={imgNavUpload} alt="imgNavUpload"/>
                <span>Upload</span>
            </div>
            <div className="navPerson">
                <img src={imgNavPerson} alt="imgNavPerson"/>
            </div>
        </nav>
      </header>
    );
  }


export default Header;
